BEGIN TRANSACTION;
CREATE TABLE history (
	host_name varchar(1024),
	domain_name varchar(1024),
	port integer,
	query_time float,
	response_time float,
	err	varchar(128),
	handler varchar(32)
);
CREATE TABLE warning (
    port int,
    domain varchar(1024),
    block_ts float,
    block_t  int default(0),
    query_t  int default(0)
);
COMMIT;
